import React from 'react';
import c from './Post.module.css';

function Post(props) {
  return (
    <div className={c.post}>
      <div><img src="https://www.pinclipart.com/picdir/middle/49-490443_avatar-icon-tlcharger-avatar-icon-clipart.png"/></div>
      {props.message}
    </div>
  );
}

export default Post;
